import React, { useState } from "react";
import Button from "react-bootstrap/Button";
import BootstrapModal from "react-bootstrap/Modal"; // Renamed the import

function MyModalComponent() { // Renamed your component
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);
  return (
    <>
      <Button variant="primary" onClick={handleShow}>
        Launch demo modal
      </Button>

      <BootstrapModal show={show} onHide={handleClose}> {/* Using the renamed import */}
        <BootstrapModal.Header closeButton>
          <BootstrapModal.Title>Modal heading</BootstrapModal.Title>
        </BootstrapModal.Header>
        <BootstrapModal.Body>Woohoo, you are reading this text in a modal!</BootstrapModal.Body>
        <BootstrapModal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={handleClose}>
            Save Changes
          </Button>
        </BootstrapModal.Footer>
      </BootstrapModal>
    </>
  );
}

export default MyModalComponent; // Export the renamed component
